    background: url(${FooterImg}) no-repeat center center;
    height: 50vh;
    margin-top: -5em;

    background-size: cover;
    height: 100%;
    width: 100%;

`;

const Heading = styled.h1`
    padding: 20em;
    position: relative; /* Ensure it is above the pseudo-element */
    z-index: 1; /* Ensures this text is above the pseudo-element */
`;

function Footer() {
